const About = () => (
    <div>
        <div>
            <ul>
                <li><Link href="/"><a>Home</a></Link></li>
                <li><Link href="/about"><a>About</a></Link></li>
            </ul>
        </div>
        <h1>About Bitz Prices</h1>
        <p>Application to view the curretn prices of various Cryptocurrency</p>
    </div>
);
export default About;
